const Repositories = () => {

  return (

    <div className="wrapper">
        <div className="flex items-center justify-center  ">
            <div className="m-1">
                <img src="./images/RepoIcon.png" alt="repo icon" className="w-10 h-5" />
            </div>

            <div className=" flex mt-1 mb-1 mr-1 justify-center   ">
                <span>Repositories</span>
            </div>
        </div>    
    </div>

  )

}

export default Repositories;
